  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Willamette Valley National Wildlife Refuge Complex
  for the next 15 years. This plan outlines the Refuge vision and purpose and describes
  how the Complex will contribute to the overall mission of the Refuge System. The
  plan provides an introduction to the Complex, an overview of the CCP process, information
  about the environment, a summary of Complex resources, goals and objectives, alternatives,
  a description of the affected environment, environmental consequences, and strategies
  for implementation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
